message:
Em Kazan já existe um TEMPLO DE TODAS AS RELIGIÕES. 😳😳😳

Combina 16 elementos de diferentes religiões, tanto modernas - por exemplo, ortodoxia, catolicismo, budismo, islamismo, judaísmo, etc., quanto extintas - por exemplo, a antiga religião assíria.

O templo foi projetado e construído com 16 cúpulas e salões dedicados a diferentes religiões, inclusive as extintas:
- Religião védica indiana;
- Taoísmo;
- Budismo zen;
- religião tibetana;
- indonésio;
- egípcio;
- religião maia
- Iraniano;
- Rosacruzes e Maçons;
- Protestantismo;
- Ortodoxia e Catolicismo;
- consciência alienígena. 😳

Até agora, apenas as salas egípcia e católica, a sala de chá, a sala de Jesus Cristo, a sala de teatro e a galeria de arte foram criadas no Templo.

